import React from 'react'
import data from './sectionInfo'

const displayTable = () => {
    {data.map(person => {
        return (
            <div className="App">
      <ul>
        {data.map(person => {
          return (
          <li>{person.firstname} {person.lastname}</li>
          )
        })}
      </ul>
    </div>
        )
    })}
}

export default displayTable
